import React from 'react';
const Navigation = () => {
  return (
    <div class="navbar-nav-scroll">
      <ul class="navbar-nav">
        <li class="nav-item active text-uppercase text-white">Documentation</li>
      </ul>
    </div>
  );
}
export default Navigation;
